import '../../../App.css';

export default function MSGFrom(props) {
  return (
    <div className='msgFrom'>
      <div className='msgFromFirst'>
        <div id='msgFromName'>{props.name}</div>
        <div id='msgFromDate'>{props.date}</div>
      </div>
      <div id='msgFromContent'>{props.content}</div>
    </div>
  )
}
